void fast_init(struct cl_base* cl, struct cl_task* ts, cl_mem image, cl_mem table, cl_mem point)
{
	int err;

	/* Create buffers on GPU device */
	_image = clCreateBuffer(cl->context,              /* context               */
						  CL_MEM_READ_ONLY,           /* flags                 */
						  640 * 480,                  /* size                  */
						  NULL,                       /* host pointer          */
						  &err);                      /* error code (return)   */
	CL_CHECK(err, "Create Buffer (_image)");
	_table = clCreateBuffer(cl->context,              /* context               */
						  CL_MEM_READ_ONLY,           /* flags                 */
						  8196,                       /* size                  */
						  NULL,                       /* host pointer          */
						  &err);                      /* error code (return)   */
	CL_CHECK(err, "Create Buffer (_table)");
	_point = clCreateBuffer(cl->context,              /* context               */
						  CL_MEM_READ_ONLY,           /* flags                 */
						  2048 * 2,                    /* size                  */
						  NULL,                       /* host pointer          */
						  &err);                      /* error code (return)   */
	CL_CHECK(err, "Create Buffer (_point)");
	_count = clCreateBuffer(cl->context,              /* context               */
						  CL_MEM_READ_ONLY,           /* flags                 */
						  4,                          /* size                  */
						  NULL,                       /* host pointer          */
						  &err);                      /* error code (return)   */
	CL_CHECK(err, "Create Buffer (_count)");

	/* Create local copies*/
	// _image = image;
	// _table = table;
	// _point = point;

	/* Build the kernel and set default parameters */
	cl_task_init(ts, cl, "kernels/fast.cl", "fast");

	/* Set kernel arguments */
	err = clSetKernelArg(ts->kernel, 0, sizeof(cl_mem), &_image);
	CL_CHECK(err, "Set Kernel Arg 0 (Image)");
	err = clSetKernelArg(ts->kernel, 1, sizeof(cl_mem), &_table);
	CL_CHECK(err, "Set Kernel Arg 1 (Table)");
	err = clSetKernelArg(ts->kernel, 2, sizeof(cl_mem), &_point);
	CL_CHECK(err, "Set Kernel Arg 2 (Point)");
	err = clSetKernelArg(ts->kernel, 3, sizeof(cl_mem), &_count);
	CL_CHECK(err, "Set Kernel Arg 3 (Count)");
}

struct points fast_run(struct cl_base* cl, struct cl_task* ts, char* l_image)
{
	int err;
	cl_event event;
	l_count = 0;

	struct points pts;

	/* Copy table to GPU (Size is hardcoded for testing purposes, mali uses shared memory) */
	err = clEnqueueWriteBuffer(cl->queue,     /* command_queue           */
							   _image,        /* buffer                  */
							   CL_TRUE,       /* blocking_read           */
							   0,             /* offset                  */
							   640*480,       /* cb                      */
							   l_image,       /* ptr                     */
							   0,             /* num_events_in_wait_list */
							   NULL,          /* event_wait_list         */
							   NULL);         /* event                   */
	CL_CHECK(err, "Write Buffer (Image)");
	err = clEnqueueWriteBuffer(cl->queue,     /* command_queue           */
							   _table,        /* buffer                  */
							   CL_TRUE,       /* blocking_read           */
							   0,             /* offset                  */
							   8196,          /* cb                      */
							   l_table,       /* ptr                     */
							   0,             /* num_events_in_wait_list */
							   NULL,          /* event_wait_list         */
							   NULL);         /* event                   */
	CL_CHECK(err, "Write Buffer (Table)");
	err = clEnqueueWriteBuffer(cl->queue,     /* command_queue           */
							   _count,        /* buffer                  */
							   CL_TRUE,       /* blocking_read           */
							   0,             /* offset                  */
							   4,             /* cb                      */
							   &l_count,      /* ptr                     */
							   0,             /* num_events_in_wait_list */
							   NULL,          /* event_wait_list         */
							   NULL);         /* event                   */
	CL_CHECK(err, "Write Buffer (Count)");

	/* Enqueue kernel */
	err = clEnqueueNDRangeKernel(cl->queue,   /* command_queue           */
								 ts->kernel,  /* kernel                  */
								 2,           /* work_dim                */
								 NULL,        /* global_work_offset      */
								 &ts->g_size, /* global_work_size        */
								 &ts->l_size, /* local_work_size         */
								 0,           /* num_events_in_wait_list */
								 NULL,        /* event_wait_list         */
								 &event);     /* event                   */
	CL_CHECK(err, "Enqueue Kernel");

	/* Copy image from GPU (Size is hardcoded for testing purposes, mali uses shared memory) */
	err = clEnqueueReadBuffer(cl->queue,      /* command_queue           */
							  _point,         /* buffer                  */
							  CL_TRUE,        /* blocking_read           */
							  0,              /* offset                  */
							  2048 * 2,        /* cb                      */
							  l_points,       /* ptr                     */
							  0,              /* num_events_in_wait_list */
							  NULL,           /* event_wait_list         */
							  NULL);          /* event                   */
	CL_CHECK(err, "Read Buffer");


	/* Copy image from GPU (Size is hardcoded for testing purposes, mali uses shared memory) */
	err = clEnqueueReadBuffer(cl->queue,      /* command_queue           */
							  _count,         /* buffer                  */
							  CL_TRUE,        /* blocking_read           */
							  0,              /* offset                  */
							  4,              /* cb                      */
							  &l_count,       /* ptr                     */
							  0,              /* num_events_in_wait_list */
							  NULL,           /* event_wait_list         */
							  NULL);          /* event                   */
	CL_CHECK(err, "Read Buffer");

	pts.count  = l_count;
	pts.coords = l_points;

	/* Wait for computation kernel to finish*/
	clWaitForEvents(1, &event);

#if 0
	/* Obtain the start- and end time for the event */
	unsigned long start = 0;
	unsigned long end = 0;
	err = clGetEventProfilingInfo(event,CL_PROFILING_COMMAND_START, sizeof(cl_ulong),&start,NULL);       
	err = clGetEventProfilingInfo(event,CL_PROFILING_COMMAND_END, sizeof(cl_ulong),&end,NULL);

	/* Compute the duration in microseconds */
	double duration = (double) (end - start) / 1000.0f;

	printf("Computation Time: %0.1lfus\n", duration);
#endif

	clReleaseEvent(event);
	return pts;
}

